import './App.css';
i

function HeaderBar(){
    return(
        <div className="header">
            <div className="Title">
                <h1>DanGo!</h1>
            </div>
            <div className="cart-icon">
                <input type="image" src="icons8-cart-50.png" className="nav-button"></input>
            </div>
        </div>
    );          
}

export default HeaderBar;
